    "description" : "Tumia eneo la maana hili kwa maneno yanayohusiana na maandiko matakatifu. Mifano imetolewa kwa maandiko matakatifu ya kikristo tu walakini unapaswa kuingiza maneno yanayotaja vitabu vitakatifu vya dini zote.",
