    "name" : "Kupanga, kurekebisha",
    "description" : "Tumia eneo la maana hili kwa maneno yanayohusiana na tendo la kupanga jambo, watu, matokeo, na mawazo--yaani, kufikiria na kuamua ratiba au mpangilio wa kundi la vitu upangwe vipi, na baada ya kuamua ni kufanya kinachohitajika ili kuliweka lile kundi katika hali ya kutumika kwa lengo fulani. Eneo la maana hili ni kama eneo la maana 7.5 'Kupanga' isipokuwa 7.5 'Kupanga' linahusu zaidi kusogeza vitu, na eneo la maana hili 7.5.5 'Kupanga, kurekebisha' linahusu zaidi wazo la kupanga kwa mantiki. Maneno katika eneo la maana hili, 7.5.5 'Kupanga, kurekebisha', hayahitaji kumaanisha kwamba vitu vimesogezwa, yanaweza kumaanisha tu kwamba wazo la kupanga kwa mantiki lipo.",
