    "key" : "8.1.1",
    "abbr" : "8.1.1",
    "name" : "Namba",
    "description" : "Tumia eneo la maana hili kwa maneno yanayohusiana na namba. Kila lugha ina neno kwa 'moja', na pia neno kwa 'mbili'. Pengine namba hizi zina maneno maalumu. Kwa hiyo, tumeingiza eneo la maana kwa 'moja' na lingine kwa 'mbili'. Pamoja na hayo eneo la maana lipo kwa namba zikiwa mfuatano (moja, mbili, tatu...). Lugha nyingi ina mfuatano zaidi ya moja wa namba (ya kwanza, ya pili, ya tatu...). Kwa hiyo tumeingiza eneo la maana kwa kila aina ya mfuatano uliopo kwenye lugha za dunia, kwa jumla. Ikiwepo kwamba lugha yako ina aina ya mfuatano wa namba mwingine uuingize katika eneo la maana 8.1.1.7 'mifuatano wa namba'.",
