    "description" : "Tumia eneo la maana hili kwa maneno yanayohusiana na namba za mpango (ya kwanza, ya pili, ya tatu) -- yaani, namba zinazotumika kuonyesha nafasi ya kitu fulani katika mfuatano, k.m., \"mtoto wa kwanza\"",
