    "description" : "Tumia eneo la maana hili kwa maneno yanayotaja tukio lilitokea mara ngapi. Inawezekana kwamba namba hizi zinaweza kuwa kielezi (kama Kiingereza) au katika lugha zingine zinaweza kuwa kitenzi (k.m., kufanya kitu mara mbili).",
    "value" : "8.1.1.3 Idadi ya mara"
