    "abbr" : "9",
    "name" : "Sarufi",
    "description" : "Tumia eneo la maana hili kwa maneno ya kiisimu yanayohusiana na maneno ya kisarufi na uundaji. Karibu zote za lugha zina maneno machache katika eneo la maana hili zikiwa na neno hata moja.",
