    "abbr" : "9.1",
    "name" : "Maneno ya kawaida",
    "description" : "Tumia eneo la maana hili kwa maneno yanayoweza kuchukua nafasi ya neno lolote. Tumia eneo la maana hili kwa maneno ya kawaida na maneno yasiyoweza kuingizwa katika maeneo ya maana mengine.",
